import React, { useState } from 'react';
import { Bell, Clock, MapPin, Search } from 'lucide-react';
import Notifications from './Notifications';

const Dashboard = ({ user, events, theme, regCount }) => {
  const isDark = theme === 'dark';
  const [isNotiOpen, setIsNotiOpen] = useState(false);

  // Switch to Notification View if the state is true
  if (isNotiOpen) {
    return (
      <div style={{ 
        maxWidth: '430px', 
        margin: '0 auto', 
        padding: '16px', 
        minHeight: '100vh',
        backgroundColor: isDark ? '#0f172a' : '#fff' 
      }}>
        <Notifications theme={theme} setIsOpen={setIsNotiOpen} />
      </div>
    );
  }

  const styles = {
    container: { 
      maxWidth: '430px', 
      margin: '0 auto', 
      padding: '16px', 
      paddingBottom: '100px', 
      minHeight: '100vh',
      backgroundColor: isDark ? '#0f172a' : '#fff',
      fontFamily: 'sans-serif'
    },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' },
    greeting: { fontSize: '28px', fontWeight: 'bold', color: isDark ? '#fff' : '#1e293b', marginBottom: '4px' },
    subText: { color: '#64748b', fontSize: '14px', marginBottom: '24px' },
    
    // Restore the Stats Section
    statsRow: { display: 'flex', flexWrap: 'wrap', gap: '12px', marginBottom: '24px' },
    statCard: { 
      flex: '1 1 calc(50% - 12px)', 
      backgroundColor: isDark ? '#1e293b' : '#f8fafc', 
      padding: '16px', 
      borderRadius: '12px', 
      color: isDark ? '#fff' : '#1e293b',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0'
    },
    
    // Event Card Styles
    eventCard: { 
      backgroundColor: isDark ? '#1e293b' : '#fff', 
      borderRadius: '24px', 
      padding: '16px', 
      marginBottom: '20px',
      border: isDark ? '1px solid #334155' : '1px solid #f1f5f9',
      boxShadow: '0 4px 6px -1px rgb(0 0 0 / 0.1)'
    },
    regBtn: { 
      width: '100%', 
      backgroundColor: '#2563eb', 
      color: '#fff', 
      border: 'none', 
      padding: '14px', 
      borderRadius: '14px', 
      fontWeight: 'bold', 
      marginTop: '16px',
      cursor: 'pointer',
      fontSize: '16px'
    }
  };

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
          <div style={{ width: '36px', height: '36px', borderRadius: '50%', backgroundColor: '#2563eb', color: '#fff', display: 'flex', justifyContent: 'center', alignItems: 'center', fontWeight: 'bold' }}>ES</div>
          <span style={{ fontWeight: 'bold', fontSize: '18px', color: isDark ? '#fff' : '#1e293b' }}>EventSphere</span>
        </div>
        <Bell 
            size={24} 
            onClick={() => setIsNotiOpen(true)} 
            style={{ cursor: 'pointer', color: isDark ? '#fff' : '#1e293b' }} 
        />
      </header>

      <h1 style={styles.greeting}>Hi Priya ðŸ‘‹</h1>
      <p style={styles.subText}>Explore college events</p>

      {/* Re-added Stats Grid */}
      <div style={styles.statsRow}>
        <div style={styles.statCard}>
          <div style={{ fontSize: '14px', color: '#64748b', marginBottom: '4px' }}>Upcoming</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>{events.length}</div>
        </div>
        <div style={styles.statCard}>
          <div style={{ fontSize: '14px', color: '#64748b', marginBottom: '4px' }}>Registered</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>{regCount}</div>
        </div>
        <div style={styles.statCard}>
          <div style={{ fontSize: '14px', color: '#64748b', marginBottom: '4px' }}>My Tickets</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>2</div>
        </div>
        <div style={styles.statCard}>
          <div style={{ fontSize: '14px', color: '#64748b', marginBottom: '4px' }}>Announcements</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>4</div>
        </div>
      </div>

      <h3 style={{ fontSize: '18px', marginBottom: '16px', color: isDark ? '#fff' : '#1e293b' }}>Upcoming Events</h3>
      
      {events.map(event => (
        <div key={event.id} style={styles.eventCard}>
          <img src={event.image} alt={event.title} style={{ width: '100%', height: '180px', objectFit: 'cover', borderRadius: '16px', marginBottom: '12px' }} />
          <h4 style={{ margin: '0 0 8px 0', fontSize: '18px', color: isDark ? '#fff' : '#1e293b' }}>{event.title}</h4>
          <div style={{ display: 'flex', alignItems: 'center', gap: '8px', fontSize: '14px', color: '#64748b' }}>
            <Clock size={16} /> {event.date}
          </div>
          <button style={styles.regBtn}>Register</button>
        </div>
      ))}
    </div>
  );
};

export default Dashboard;
